pragma solidity ^0.4.2;

contract FundChain{

    struct PhilantropyAgent{
        string agentName;
        string agentDescription;
        string agentImage;
        address agentAddress;
        uint agentDonationCount;
    }

    struct NonProfitDistributors{
        //address beneficiary;
        string distributorName;
        string distributorImage;
        string distributorLink;
        address distributorAddress;
        uint distributorFundRecievedCount;
    }

    struct GrassrootLevelUser{

        string userName;
        string userImage;
        address userAddress;
        string userFunctionMsg;
        uint fundsRecieved;
    }
    
    mapping(uint=>string) public endUserSupplyChains;
    PhilantropyAgent public agent;
    NonProfitDistributors public distributor;
    uint public noOfEndUsers=0;
    string public endUserUpdateMsg;
    GrassrootLevelUser public endUser;

    constructor() public {
       
        //Need a better way to do initialize class members
        agent=PhilantropyAgent("Brock Edward Lesnar","Former-UFC and WWE-Universal Champion","https://www.wwe.com/f/styles/og_image/public/rd-talent/Bio/Brock_Lesnar_bio.png",0x287cfb49cebac74dd0b28fa8de3a4d0ecc8d3a7c,0);
        //distributor=NonProfitDistributors("Cheif Minister's Relief Fund","https://cdn.downtoearth.org.in/library/large/2018-08-23/0.42716000_1535013850_23.jpg","https://donation.cmdrf.kerala.gov.in/",0x31f9Aae8434Bb4A09d969871CDd59A5B12E90d5f,0);
    }

    function makePaymentToDistributors(string _distributorName,string _distributorImage,string _distributorLink,uint _distributorFundRecievedCount) payable public{
        distributor=NonProfitDistributors("Cheif Minister's Relief Fund","https://cdn.downtoearth.org.in/library/large/2018-08-23/0.42716000_1535013850_23.jpg","https://donation.cmdrf.kerala.gov.in/",0x31f9Aae8434Bb4A09d969871CDd59A5B12E90d5f,_distributorFundRecievedCount);

    } 

    function makePaymentToEndUsers(uint _receivedCount) payable public{
        endUser=GrassrootLevelUser("Help in Need Food Retail","https://cdn.downtoearth.org.in/library/large/2018-08-23/0.42716000_1535013850_23.jpg",0xE61582efb7DaD1b68494173b509b38F0BEaF2D82,"Default Message" ,_receivedCount);
        
    } 

    function updateEndUserMessage(string _msg) public{
        endUserUpdateMsg=_msg;
    }

}
